var input = `



`;

input = input.split("\n");

var keypad = [
  [1, 2, 3],
  [4, 5, 6],
  [7, 8, 9]
];

var position = {x: 1, y: 1};

input.map(function(inputString) {
  for(var i = 0; i < inputString.length; i++)
  {
    var axis;
    var delta;
    switch(inputString[i])
    {
      case "U":
        axis = "y";
        delta = -1;
        break;
      case "D":
        axis = "y";
        delta = 1;
        break;
      case "L":
        axis = "x";
        delta = -1;
        break;
      case "R":
        axis = "x";
        delta = 1;
        break;
    }
    position[axis] = Math.min(2, Math.max(0, position[axis] + delta));
  }
  return keypad[position.y][position.x];
})
